import "./login.css";

const Login = () => {
  return (
    <div className="login-form">
      <img src="/logo-easyway.jpg" alt="Logo" />
      <p className="inicio-sesion-text">Inicio de Sesion</p>
      <p className="facil-text">
        Inicia sesion para comprar facil, rapido y seguro
      </p>

      <input
        type="text"
        className="input-wrapper"
        placeholder="Correo electrónico"
      />

      <input type="text" className="input-wrapper" placeholder="Contraseña" />

      <image className="logo"></image>
    </div>
  );
};

export default Login;
